import { BrowserRouter as Router, Link, Route, Switch } from 'react-router-dom';
import Counter from './Counter';

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/">
          <Counter />
        </Route>
        <Route expect path="*">
          <p>404 | Page not found</p>
          <p>
            <Link to={`${process.env.PUBLIC_URL}/`}>Back to Home</Link>
          </p>
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
